import React from 'react';
import './About.css'; // Assuming you have a CSS file

// --- IMPORT YOUR LOCAL IMAGES HERE ---
// ".." means go up one folder, then into "assets"
import founder1 from '../assets/founder1.jpg'; 
// import founder2 from '../assets/founder2.jpg'; // Uncomment if you have more

const About = () => {
  return (
    <div className="about-container">
      <div className="about-header">
        <h1>About AutoRent</h1>
        <p>Your journey, our priority.</p>
      </div>

      {/* Founders Section */}
      <div className="founders-section">
        <h2>Meet the Founders</h2>
        <div className="founders-grid">

          {/* Founder Card 1 */}
          <div className="founder-card">
            <div className="image-wrapper">
              {/* USE THE IMPORTED VARIABLE HERE */}
              <img src={founder1} alt="Nithish - Founder" />
            </div>
            <h3>Nithish</h3>
            <p className="role">CEO & Founder</p>
            <p className="bio">
              Passionate about technology and automobiles, Nithish started AutoRent 
              to make premium mobility accessible to everyone in Chennai.
            </p>
          </div>

          {/* Founder Card 2 (Example) */}
          <div className="founder-card">
            <div className="image-wrapper">
              <img src="https://via.placeholder.com/150" alt="Co-Founder" />
            </div>
            <h3>Co-Founder Name</h3>
            <p className="role">Chief Operations Officer</p>
            <p className="bio">
              Ensuring every ride is smooth, safe, and memorable for our customers.
            </p>
          </div>

        </div>
      </div>
    </div>
  );
};

export default About;
